import React from 'react'
import { Switch, Route, Router } from "react-router-dom";
import Dashbord from '../views/Dashbord/Dashbord';
import Application from '../views/ Applications/Application';
import Userprofile from '../views/ueseprofile/Userprofile';
export default function Sidebarcontent() {
    return (



<div>

<Switch>

                <Route exact path='/dashbord'><Dashbord /></Route>
                <Route exact path="/userprofile"><Userprofile/></Route>
                <Route exact path="/aplication"> <Application /></Route>
            </Switch>
</div>

    )
}
